window.bookSummaryJSON = "<p>How do you raise a boy who can bend reality with his mind? How do you keep him levelheaded, sane, and good? Raising any child is a tremendous undertaking, let alone one blessed by the goddess herself. Levi Guildersleeve, retired soldier and successful collector of rare books, finds himself as the only male role model of the most powerful witch ever born. This is a prequel story of the childhood of Declan O'Carroll, as told by Levi.</p>"; 
